import React from 'react';
import { useNavigate } from 'react-router-dom';

function Upload() {
  const navigate = useNavigate();
  
  return (
    <div>
      <h1>感谢您的发布</h1>
      <p>您的物品已经成功发布，感谢您的支持！</p>
      <button onClick={() => navigate('/')}>返回首页</button>
    </div>
  );
}

export default Upload;
